def matrix_chain_order(p, n):

    def show_brackets(i, j, brackets):
        nonlocal char, cnt, string
        if i == j:
            if cnt != 0:
                string += chr(ord(char) + cnt)
            else:
                string += char
            if char == 'Z':
                char = 'A'
                cnt += 1
            else:
                char = chr(ord(char) + 1)
        else:
            string += '('
            show_brackets(i, brackets[i][j], brackets)
            show_brackets(brackets[i][j] + 1, j, brackets)
            string += ')'
        return string
    n += 1
    ans = [[0] * n for _ in range(n)]
    brackets = [[0] * n for _ in range(n)]
    (size, j) = (1, 0)
    cost = 0
    char = 'A'
    cnt = 0
    string = ''
    while size < n:
        i = 0
        while i < n - size:
            j = i + size
            ans[i][j] = sys.maxsize
            k = i
            while k < j:
                cost = ans[i][k] + ans[k + 1][j] + p[i] * p[j + 1] * p[k + 1]
                if cost < ans[i][j]:
                    ans[i][j] = cost
                    brackets[i][j] = k
                k += 1
            i += 1
        size += 1
    return show_brackets(0, n - 1, brackets)

